import React from 'react';
import { useNavigate } from 'react-router-dom';
import { logout } from '../services/authService';

const Header = ({ onSearch }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <header className="bg-blue-600 text-white shadow-md sticky top-0 z-50">
      <div className="max-w-7xl mx-auto flex flex-col sm:flex-row items-center justify-between p-4 gap-3">
        <h1 className="text-xl font-bold tracking-wide">Product Viewer</h1>

        <div className="flex w-full sm:w-auto gap-2">
          <input
            type="text"
            placeholder="Search products..."
            className="flex-1 sm:flex-none rounded-lg p-2 text-black focus:outline-none focus:ring-2 focus:ring-white transition"
            onChange={e => onSearch(e.target.value)}
          />
          <button
            onClick={handleLogout}
            className="bg-red-500 hover:bg-red-600 transition px-4 py-2 rounded-lg font-semibold shadow"
          >
            Logout
          </button>
        </div>
      </div>
    </header>
  );
};

export default Header;
